import React,{useState} from 'react';

const Boards = ({boards,setBoards}) => {
    return (
        <div className='boards'>
            {boards.map(board=>
            <div className='boards__elem' key={board.id}>
                {board.list.map(task=>
                <div className='boards__task' key={task.id}>
                    {task.body}
                </div>)}
            </div>)}
        </div>
    );
};

export default Boards;
